const Content = ({parts}) => {
    console.log(parts)
    return (
      <div>
        <Part part={parts[0]}/>
        <Part part={parts[1]}/>
        <Part part={parts[2]}/>
      </div>
    )
  }

const Part = ({name, exercises}) => {
    return (
      <div>
        <p>{name}, No. of Exercises: {exercises}</p>
      </div>
    )
  }

export default Content
